import React from 'react';

const Item = (props) => {
   
    function ChildComponent(props) {
        return (
          <div>
            {props.myArray.map((item, index) => (
              <p key={index}>{item}</p>
            ))}
          </div>
        );
      }

    return (
        <div>
           <div>f
           {ChildComponent}
            f
           </div>
        </div>
    );
};

export default Item;
